assignments.value:
={{
'https://wa.me/55' + 
$json.telefone_celular.match( /\d+/g ).join('') + 
'?text=' + encodeURIComponent(`Olá, ${$json.nome.toLowerCase().replace(/\b\w/g, c => c.toUpperCase())}, hoje é um dia especial e não poderíamos deixar de lembrar! Desejamos muitas felicidades, saúde e sucesso. Conte sempre com a gente. TopBrasil🎉`)
}}

parameters.messageText:
={{ 
'Olá ' + $('buscaTopAniversariantes').item.json.nome_voluntario.toLowerCase().replace(/\b\w/g, c => c.toUpperCase()) + ', ' +
'hoje ' + $now.format('dd/MM/yyyy') + ' é aniversário de alguns dos nossos associados na TopBrasil 🤖' + '.\n' +
  'Clique nos links para enviar mensagens para o WhatsApp: \n\n' + $('unificaTextoMensagens').item.json.mensagens.join('\n')
}}
